import React from "react";
import WebampWindow from "./components/WebampWindow";

function App() {
  return (
    <>
      <div className="window" style={{ maxWidth: "720px", margin: "40px auto" }}>
        <div className="title-bar">
          <div className="title-bar-text">Hi I'm Bohyeon &lt;3</div>
          <div className="title-bar-controls">
            <button aria-label="Minimize" />
            <button aria-label="Maximize" />
            <button aria-label="Close" />
          </div>
        </div>
        <div className="window-body">
          <p><strong>ðŸ’¾ Retro Portfolio Site</strong></p>
          <p>Built with win95.css, Webamp, and draggable windows.</p>
          <img src={`${process.env.PUBLIC_URL}/assets/icons/computer-3.png`} alt="icon" />
        </div>
      </div>

      <WebampWindow />
    </>
  );
}

export default App;
